UPDATE etfs_ativos_reais 
    SET dividends_12m = CASE symbol
        WHEN 'NUSB' THEN 0.376 WHEN 'QQQE' THEN 0.603 WHEN 'CBON' THEN 0.13 WHEN 'ZTRE' THEN 0.7890000000000001 WHEN 'EPHE' THEN 1.119 WHEN 'MLPA' THEN 3.68 WHEN 'PCEF' THEN 0.529 WHEN 'DWX' THEN 1.629 WHEN 'RAYD' THEN 1.029 WHEN 'VSMV' THEN 0.254 WHEN 'DVYA' THEN 2.163 WHEN 'SCHY' THEN 1.0550000000000002 WHEN 'VDE' THEN 3.915 WHEN 'WOOD' THEN 3.6790000000000003 WHEN 'UUP' THEN 3.8360000000000003 WHEN 'SQLV' THEN 0.487 WHEN 'IEDI' THEN 0.506 WHEN 'IBTI' THEN 0.28900000000000003 WHEN 'GXC' THEN 4.817 WHEN 'SHUS' THEN 1.8490000000000002
    END,
    updatedat = NOW()
    WHERE symbol IN ('NUSB', 'QQQE', 'CBON', 'ZTRE', 'EPHE', 'MLPA', 'PCEF', 'DWX', 'RAYD', 'VSMV', 'DVYA', 'SCHY', 'VDE', 'WOOD', 'UUP', 'SQLV', 'IEDI', 'IBTI', 'GXC', 'SHUS');